<!DOCTYPE html>
<html lang="en">

    <head>
        <meta charset="UTF-8">
        <title>autoComplete.js - Simple autocomplete pure vanilla Javascript library.</title>
        <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
        <meta name="description" content="Simple autocomplete pure vanilla Javascript library.">
        <meta name="viewport" content="width=device-width, user-scalable=no, initial-scale=1.0, maximum-scale=1.0, minimum-scale=1.0">
        <link rel="stylesheet" href="//unpkg.com/docsify/lib/themes/vue.css">
        <link href="https://fonts.googleapis.com/css?family=PT+Sans" rel="stylesheet" />
        <style>
            .app-name-link>img {
                width: 200px;
                padding-bottom: 20px;
            }
        </style>
    </head>

    <body>
        <div id="app"></div>
        <script>
            window.$docsify = {
                ga: 'UA-129399191-1',
                name: 'autoComplete.js',
                logo: 'https://www.tarekraafat.com/dev/projects/autoComplete/README/img/autoComplete.js.svg',
                repo: 'https://github.com/TarekRaafat/autoComplete.js',
                coverpage: true,
                themeColor: '#64CEAA',
            }
        </script>
        <script src="//unpkg.com/docsify/lib/docsify.min.js"></script>
        <script src="//unpkg.com/docsify/lib/plugins/ga.min.js"></script>
        <!-- <script src="//unpkg.com/docsify/lib/plugins/search.min.js"></script> -->
        <script src="//unpkg.com/docsify-copy-code"></script>
    </body>

</html>
